import { useEffect, useState } from 'react';


function AddProduct() {
  const [data, setData] = useState([]);

  useEffect(() => {
      const fetchData = async () => {
          try {
              let response = await fetch("http://localhost:8000/api/get-all/3");
              response = await response.json();
              setData(response);
              console.log("data", data); // This will show the previous state of data, not the updated one
          } catch (error) {
              console.error('Error fetching data:', error);
          }
      };

      fetchData();
  }, []);
  console.log("data",data);
  
